import React from 'react';
import Icofont from 'react-icofont';
import { useSelector, useDispatch } from "react-redux";

const PageList = () => {

  const { pageList, page, start, end, prev, next } = useSelector(state => state.arts.pageResult)

  const dispatch = useDispatch()

  console.log("PageList : " + pageList);

  const movePage = (page) => {
    dispatch()
  }

  const list = pageList.map(i => (
    <li className="active">
      <a href={process.env.PUBLIC_URL}>1</a>
    </li>
  ))

  return (
    <div className="row mt-100">
      <div className="col-md-12">
        <div className="text-center">
          <div className="pagination dark-color">
            <ul>
              <li>
                <Icofont
                  icon="long-arrow-left"
                  className="mr-5 xs-display-none"
                />
                Prev
              </li>
              {list}
              <li>
                Next
                <Icofont
                  icon="long-arrow-right"
                  className="ml-5 xs-display-none"
                />
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  )
}

export default PageList
